import React from 'react';

const InforLine = () => {
  return (
    <View styles={[styles.flexBetween,styleGlobal ]}>
      <View>
        <Text>TS r√≤ng TKCK</Text></View>
      <View>
        <Text>{formatMoney(1200000)}</Text>
      </View>
    </View>
  );
};

export default InforLine;

const styles = StyleSheet.create({ 
  flexBetween: {  
